import React from 'react';

function Footer() {
    return(
        <footer className='bg-dark text-white'>
            <Container>
                <Row>
                    <Col>
                        <p>2023 React</p>
                    </Col>
                </Row>
            </Container>
        </footer>
    )
}

export default Footer;
